import React from "react";
import Day from "./Day";
import PropTypes from 'prop-types';

class Forecast extends React.Component {

  render() {
  	var items = ['Jake', 'Jon', 'Thruster'];
  	console.log("DAYSS",this.props);
  	var items = this.props.days;
  	return (
			<ul className="forecast">
				{items.map(function(item, index){
					return <li><Day dayname="Tue" tmpMax={item} tmpMin={item} iconName={item} /></li>;
    		})}
			</ul>
    );
  }
}

Forecast.propTypes = {
  days: PropTypes.array
};

export default Forecast;
